                          className="block w-full pl-10 pr-3 py-3 text-gray-700 bg-gray-50 rounded-lg border-transparent focus:bg-white focus:border-primary focus:ring-0 transition-colors"
                          placeholder="Your name"
                        />
                      </div>
                    </div>

                    <div>
                      <label htmlFor="phone" className="block text-sm font-medium text-gray-700 mb-1">Phone Number</label>
