                          <FontAwesomeIcon icon={faPhone} className="w-4 h-4" />
                        </div>
                        <input
                          type="tel"
                          id="phone"
                          name="phone"
                          value={formData.phone}
                          onChange={handleChange}
                          className="block w-full pl-10 pr-3 py-3 text-gray-700 bg-gray-50 rounded-lg border-transparent focus:bg-white focus:border-primary focus:ring-0 transition-colors"
                          placeholder="Your phone number"
                        />
                      </div>
                    </div>

                    <div>
                      <label htmlFor="email" className="block text-sm font-medium text-gray-700 mb-1">Email Address</label>
                      <div className="relative">
                        <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none text-gray-400">
                          <FontAwesomeIcon icon={faEnvelope} className="w-4 h-4" />
                        </div>
                        <input
                          type="email"
                          id="email"
                          name="email"
                          value={formData.email}
                          onChange={handleChange}
                          className="block w-full pl-10 pr-3 py-3 text-gray-700 bg-gray-50 rounded-lg border-transparent focus:bg-white focus:border-primary focus:ring-0 transition-colors"
                          placeholder="Your email address"
                        />
                      </div>
                    </div>

                    <div>
                      <label htmlFor="address" className="block text-sm font-medium text-gray-700 mb-1">Delivery Address</label>
                      <div className="relative">
                        <div className="absolute top-3 left-3 flex items-start pointer-events-none text-gray-400">
                          <FontAwesomeIcon icon={faHome} className="w-4 h-4" />
                        </div>
                        <textarea
                          id="address"
                          name="address"
                          value={formData.address}
                          onChange={handleChange}
                          rows="3"
                          className="block w-full pl-10 pr-3 py-3 text-gray-700 bg-gray-50 rounded-lg border-transparent focus:bg-white focus:border-primary focus:ring-0 transition-colors"
                          placeholder="Your delivery address"
                        ></textarea>
                      </div>
                    </div>

                    <button
                      type="submit"
                      className="w-full bg-gradient-to-r from-gray-900 to-gray-800 hover:from-gray-800 hover:to-gray-700 text-white font-medium px-6 py-4 rounded-xl shadow-md transition-all flex items-center justify-center gap-2"
                    >
                      <span>Start Your Free Trial</span>
                      <FontAwesomeIcon icon={faArrowRight} className="w-4 h-4" />
                    </button>

                    <p className="text-xs text-gray-500 text-center">
                      By submitting, you agree to our Terms of Service and Privacy Policy.
                    </p>
                  </form>
                )}
              </div>
            </div>
          </motion.div>
        </div>
      </div>
    </section>
  );
};

